def LongestSubstr(s):
    ls=list(s)
    i=0
    ns=0
    while i < len(ls):
        j=0
        nls=ls[i:]
        #print(nls)
        nlist=[]
        ss=''
        while j < len(nls):
            if nls[j] in nlist:
                #nlist.append(j)
                ss=''.join(nlist)
                #print(ss)
                break
            else:
                nlist.append(nls[j])
                ss=''.join(nlist)
                #print(ss)
            j=j+1
        i=i+1
        ns=max(ns,len(ss))
        '''if len(ns)> len(ss):
            pass
        else:
            ns=ss'''
    return ns



